import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import BusinessGrid from './BusinessGrid';
import TargetList from './TargetList';

const DashboardContainer = styled.div`
  min-height: 100vh;
  background-color: #f8fafc;
`;

const Header = styled.header`
  background: white;
  border-bottom: 1px solid #e5e7eb;
  padding: 1rem 2rem;
  display: flex;
  justify-content: space-between;
  align-items: center;
  box-shadow: 0 1px 3px 0 rgba(0, 0, 0, 0.1);
`;

const Logo = styled.div`
  font-size: 1.5rem;
  font-weight: 700;
  color: #1e293b;
`;

const UserInfo = styled.div`
  display: flex;
  align-items: center;
  gap: 1rem;
`;

const BusinessName = styled.span`
  font-size: 1.1rem;
  font-weight: 500;
  color: #374151;
`;

const LogoutButton = styled.button`
  padding: 0.5rem 1rem;
  background-color: #ef4444;
  color: white;
  border-radius: 8px;
  font-size: 0.9rem;
  font-weight: 500;
  transition: background-color 0.2s ease;

  &:hover {
    background-color: #dc2626;
  }
`;

const MainContent = styled.div`
  display: flex;
  min-height: calc(100vh - 80px);

  @media (max-width: 768px) {
    flex-direction: column;
  }
`;

const LeftPanel = styled.div`
  flex: ${props => props.isSplit ? '1' : '1'};
  padding: 2rem;
  transition: flex 0.3s ease;

  @media (max-width: 768px) {
    padding: 1rem;
    flex: none;
  }
`;

const RightPanel = styled.div`
  flex: ${props => props.isSplit ? '1' : '0'};
  background: white;
  border-left: 1px solid #e5e7eb;
  transition: flex 0.3s ease;
  overflow: hidden;
  min-width: ${props => props.isSplit ? '400px' : '0'};

  @media (max-width: 768px) {
    border-left: none;
    border-top: 1px solid #e5e7eb;
    min-width: auto;
    flex: none;
    max-height: 50vh;
  }
`;

const Dashboard = ({ user, onLogout }) => {
  const [businesses, setBusinesses] = useState([]);
  const [selectedBusiness, setSelectedBusiness] = useState(null);
  const [isSplit, setIsSplit] = useState(false);
  const [targets, setTargets] = useState([]);

  useEffect(() => {
    // 임시 데이터 로드
    const mockBusinesses = [
      {
        id: 1,
        name: '서울시 강남구 사업',
        description: '강남구 지역 대상자 관리',
        targetCount: 150,
        status: 'active',
        createdAt: '2024-01-15'
      },
      {
        id: 2,
        name: '부산시 해운대구 사업',
        description: '해운대구 지역 대상자 관리',
        targetCount: 89,
        status: 'active',
        createdAt: '2024-01-20'
      },
      {
        id: 3,
        name: '대구시 수성구 사업',
        description: '수성구 지역 대상자 관리',
        targetCount: 67,
        status: 'inactive',
        createdAt: '2024-02-01'
      },
      {
        id: 4,
        name: '인천시 연수구 사업',
        description: '연수구 지역 대상자 관리',
        targetCount: 45,
        status: 'active',
        createdAt: '2024-02-10'
      }
    ];
    setBusinesses(mockBusinesses);
  }, []);

  const handleBusinessSelect = (business) => {
    setSelectedBusiness(business);
    setIsSplit(true);
    
    // 임시 대상자 데이터 로드
    const mockTargets = [
      {
        id: 1,
        name: '김철수',
        phone: '010-1234-5678',
        address: '서울시 강남구 테헤란로 123',
        status: 'active',
        registeredAt: '2024-01-15'
      },
      {
        id: 2,
        name: '이영희',
        phone: '010-2345-6789',
        address: '서울시 강남구 역삼동 456',
        status: 'active',
        registeredAt: '2024-01-16'
      },
      {
        id: 3,
        name: '박민수',
        phone: '010-3456-7890',
        address: '서울시 강남구 논현동 789',
        status: 'inactive',
        registeredAt: '2024-01-17'
      }
    ];
    setTargets(mockTargets);
  };

  const handleCloseSplit = () => {
    setIsSplit(false);
    setSelectedBusiness(null);
    setTargets([]);
  };

  const handleTargetUpdate = (updatedTargets) => {
    setTargets(updatedTargets);
  };

  return (
    <DashboardContainer>
      <Header>
        <Logo>나눔번들</Logo>
        <UserInfo>
          <BusinessName>{user.businessName}</BusinessName>
          <LogoutButton onClick={onLogout}>
            로그아웃
          </LogoutButton>
        </UserInfo>
      </Header>

      <MainContent>
        <LeftPanel isSplit={isSplit}>
          <BusinessGrid 
            businesses={businesses}
            onBusinessSelect={handleBusinessSelect}
            selectedBusiness={selectedBusiness}
          />
        </LeftPanel>

        <RightPanel isSplit={isSplit}>
          {isSplit && selectedBusiness && (
            <TargetList
              business={selectedBusiness}
              targets={targets}
              onClose={handleCloseSplit}
              onTargetUpdate={handleTargetUpdate}
            />
          )}
        </RightPanel>
      </MainContent>
    </DashboardContainer>
  );
};

export default Dashboard;
